function Network(sizes, weight, biases, numOfLayers) {
    this.sizes = sizes
    this.weight = weight
    this.biases = biases
    this.numOfLayers = numOfLayers
    this.forward = function(input) {
        var activations = new Array(this.numOfLayers)
        for (var layer = 0; layer != this.numOfLayers; ++layer) {
            activations[layer] = new Array(this.sizes[layer])
            for (var index = 0; index != this.sizes[layer]; ++index)
                activations[layer][index] = 0
        }
        for (var index = 0; index != this.sizes[0]; ++index)
            activations[0][index] = input[index]

        for (var layer = 0; layer != (this.numOfLayers - 1); ++layer) {
            for (var indexOfNowLayer = 0; indexOfNowLayer != this.sizes[layer + 1]; ++indexOfNowLayer) {
                var z = 0
                for (var indexOfLastLayer = 0; indexOfLastLayer != this.sizes[layer]; ++indexOfLastLayer)
                    z += (activations[layer][indexOfLastLayer] * this.weight[layer][indexOfNowLayer][indexOfLastLayer])
                z += this.biases[layer][indexOfNowLayer]
                activations[layer + 1][indexOfNowLayer] = sigmoid(z)
            }
        }

        var indexOfMaxValue = 0
        var maxValue = -1000
        for (var index = 0; index != sizes[numOfLayers - 1]; ++index)
            if (activations[numOfLayers - 1][index] > maxValue) {
                indexOfMaxValue = index
                maxValue = activations[numOfLayers - 1][index]
            }
        return indexOfMaxValue
    }
}

