function printImg(img, weight, height, name='None', threshold=200) {
    console.log(name)

    var canvasUseToPrint = document.createElement("canvas")
    var ctx = canvasUseToPrint.getContext('2d')
    document.body.appendChild(canvasUseToPrint)
    canvasUseToPrint.width = weight
    canvasUseToPrint.height = height
    var imgData = ctx.createImageData(weight, height)
    for (var i = 0; i != weight; ++i) {
        for (var j = 0; j != height; ++j) {
            var index = (i + j * weight) * 4
            if (img[i][j] >= threshold) {
                imgData.data[index] = 255
                imgData.data[index + 1] = 255
                imgData.data[index + 2] = 255
            } else {
                imgData.data[index] = 0
                imgData.data[index + 1] = 0
                imgData.data[index + 2] = 0
            }
            
            imgData.data[index + 3] = 255
        }
    }
    ctx.putImageData(imgData, 0, 0)

    console.log(img)
}

function RGBA2Grey(imgData, weight, height) {
    var imgGrey = new Array(weight)
    for (var i = 0; i != weight; ++i) {
        imgGrey[i] = new Array(height)
        for (var j = 0; j != height; ++j)
            imgGrey[i][j] = 0
    }

    for (var x = 0; x != weight; ++x) {
        for (var y = 0; y != height; ++y) {
            var index = (x + y * weight) * 4
            imgGrey[x][y] = (0.3*imgData[index] + 0.59*imgData[index+1] + 0.11*imgData[index+2])
        }
    }
    return imgGrey
    
}

function Grey2Binary(imgGrey, threshold, weight, height) {
    for (var x = 0; x != weight; ++x) {
        for (var y = 0; y != height; ++y) {
            if (imgGrey[x][y] >= threshold) {
                imgGrey[x][y] = 255
            }
            else {
                imgGrey[x][y] = 0
            }
        }
    }
    return imgGrey
}

function denoise1(img, weight, height) {
    // get rid of noise points
    var xDirection = [0, 0, -1, 1, -1, -1, 1, 1]
    // Up, Down, Left, Right, LeftUp, LeftDown, RightUp, RightDown
    var yDirection = [1, -1, 0, 0, 1, -1, 1, -1]
    for (var x = 0; x!=weight; ++x) {
        for (var y = 0; y!=height; ++y) {
            if ((x<6) || (y<5) || (x>(weight-12)) || (y>(height-4)) || (img[x][y] == 255)) {
                img[x][y] = 255
            }
        }
    }
    for (var x = 1; x<(weight-1); x++) {
        for (var y = 1; y<(height-1); y++) {
            var count = 0
            for (var k = 0; k!=8; ++k)
                if (img[x+xDirection[k]][y+yDirection[k]] == 255)
                    count ++
            if (count > 5)
                img[x][y] = 255
        }
    }
    return img
}

function clean(img, weight, height) {
    for (var x = 0; x!=weight; ++x) {
        for (var y = 0; y!=height; ++y) {
            if ((x<2) || (y<2) || (x>(weight-6)) || (y>(height-4)) || (img[x][y] == 255)) {
                img[x][y] = 255
            }
        }
    }
    return img
}

function denoise2(img, weight, height) {
    // get rid of noise lines
    for (var x = 0; x!=weight; ++x) {
        for (var y = 0; y!=(height-1); ++y) {
            if (img[x][y] == 0) {
                var lineData = getLine(img, x, y)
                if (lineData.length >= 16) {
                    console.log('There is a line!')
                    console.log(lineData)
                    img = deleteLine(img, lineData, 1)
                }
            }
        }
    }
    return img
}

function getLine(img, x, y) {
    var direction = 0
    // 0-Unknown, 1-Up, 2-Down
    var lineData = new Array()
    var weight = img.length
    var height = img[0].length
    while (true) {
        lineData.push([x, y])
        if (x == (weight-1))
            break
        if (img[x+1][y] == 0) {
            x ++
            continue
        }
        if (img[x+1][y] == 255) {
            if ((y > 0) && (img[x+1][y-1] == 0) && (direction != 2)) {
                x ++
                y --
                direction = 1
                continue
            }
            if ((y < (height-1)) && (img[x+1][y+1] == 0) && (direction != 1)) {
                x ++
                y ++
                direction = 2
                continue
            }
            break
        }
    }
    return lineData
}

function deleteLine(img, lineData, width) {
    var xDirection = [2, 2, 2, 1, 0, -1, -2, -2, -2, -2, -2, -1, 0, 1, 2, 2]
    var yDirection = [0, 1, 2, 2, 2, 2, 2, 1, 0, -1, -2, -2, -2, -2, -2, -1]
    var length = lineData.length
    var weight = img.length
    var height = img[0].length
    for (var i = 0; i!=length; ++i) {
        for (var dw = 0; dw!=width; ++dw) {
            var x = lineData[i][0]
            var y = lineData[i][1] + dw
            if ((x > 1) && (x < (weight-2)) && (y > 1) && (y < (height-2))) {
                var count = 0
                for (var k = 0; k != 16; ++k)
                    if (img[x + xDirection[k]][y + yDirection[k]] == 0)
                        count ++
                if (count > 6)
                    continue

            }
            if ((y >= 0) && (y <= (height-1)))
                img[x][y] = 255
        }
    }
    return img
}

function cutCharacter(img, weight, height) {
    var imgCopy = new Array(weight)
    for (var x = 0; x!=weight; ++x) {
        imgCopy[x] = new Array(height)
        for (var y = 0; y!=height; ++y) {
            if (img[x][y] == 0)
                imgCopy[x][y] = 1
            else 
                imgCopy[x][y] = 0
        }
    }
    console.log(imgCopy)
    
    var miniNoiseLength = 0
    var number = 0
    var record = new Array()

    var flag = false
    var begin_x = 0
    var end_x = 0
    var begin_y = 0
    var end_y = 0
    var miniLength = 5
    var maxiLength = 23
    for (var x = 0; x!=weight; ++x) {
        var sum_x = 0
        for (var y = 0; y!=height; ++y) {
            sum_x += imgCopy[x][y]
        }
        if ((flag == false) && (sum_x > miniNoiseLength)) {
            flag = true
            begin_x = x
        }
        if ((flag == true) && (sum_x <= miniNoiseLength)) {
            flag = false
            end_x = x
            if ((end_x - begin_x) <= miniLength)
                continue
            record.push([begin_x, 0, end_x, 0])
            number ++
        }
        if ((flag == true) && (sum_x > miniNoiseLength) && ((x - begin_x) >= maxiLength)) {
            end_x = x
            record.push([begin_x, 0, end_x, 0])
            number ++
            begin_x = x
        }
    }

    console.log('number: ' + number)

    for (var i = 0; i!=number; ++i) {
        flag = false
        begin_x = record[i][0]
        end_x = record[i][2]
        begin_y = 0
        end_y = 0

        for (var y = 0; y!=height; ++y) {
            var sum_y = 0
            for (var x = begin_x; x <= end_x; ++x) {
                sum_y += imgCopy[x][y]
            }
            if ((flag == false) && (sum_y > miniNoiseLength)) {
                begin_y = y
                flag = true
            }
            if (sum_y > miniNoiseLength)
                end_y = 0
            if ((sum_y <= miniNoiseLength) && (end_y == 0) )
                end_y = y
        }
        record[i][1] = begin_y
        record[i][3] = end_y
    }

    var characters = new Array(number)
    for (var i = 0; i!=number; ++i) {
        begin_x = record[i][0]
        begin_y = record[i][1]
        var characterWeight = record[i][2] - record[i][0] + 1
        var characterHeight = record[i][3] - record[i][1] + 1
        console.log(characterWeight + ',' + characterHeight)
        var character = new Array(characterWeight)
        for (var x = 0; x!=characterWeight; ++x) {
            character[x] = new Array(characterHeight)
            for (var y = 0; y!=characterHeight; ++y)
                character[x][y] = img[begin_x + x][begin_y + y]
        }
        characters[i] = character
    }
    return characters
}

function lanczos(x, coreSize) {
    if (Math.abs(x) <= 1e-16)
        return 1.0
    if ((x >= -coreSize) && (x <= coreSize))
        return coreSize*Math.sin(Math.PI * x)*Math.sin(Math.PI * x / coreSize) / (Math.PI*Math.PI*x*x)
    return 0.0
}

function resize(img, destWeight, destHeight) {
    originWeight = img.length
    originHeight = img[0].length
    var dest_img = new Array(destWeight)
    for (var i = 0; i!=destWeight; ++i) {
        dest_img[i] = new Array(destHeight)
        for (var j = 0; j!=destHeight; ++j) {
            dest_img[i][j] = 0
        }
    }
    scaleOfWeight = originWeight / destWeight
    scaleOfHeight = originHeight / destHeight
    rcp_scaleOfWeight = 1.0 / scaleOfWeight
    rcp_scaleOfHeight = 1.0 / scaleOfHeight
    coreSize = 3.0
    supportSize_x = coreSize * scaleOfWeight
    supportSize_y = coreSize * scaleOfHeight

    for (var x = 0; x!=destWeight; ++x) {
        for (var y = 0; y!=destHeight; ++y) {
            var origin_x = (x + 0.5) * scaleOfWeight
            var origin_y = (y + 0.5) * scaleOfHeight
            var x_min = Math.round(origin_x - supportSize_x + 0.5)
            var x_max = Math.round(origin_x + supportSize_x + 0.5)
            var y_min = Math.round(origin_y - supportSize_y + 0.5)
            var y_max = Math.round(origin_y + supportSize_y + 0.5)
            if (x_min < 0) x_min = 0
            if (x_max > originWeight) x_max = originWeight
            if (y_min < 0) y_min = 0
            if (y_max > originHeight) y_max = originHeight

            var w = 0
            var sum_w = 0
            var range_x = x_max - x_min
            var range_y = y_max - y_min
            for (var i = 0; i < range_x; i++)
                for (var j = 0; j < range_y; j++) {
                    w = lanczos((i + x_min - origin_x + 0.5) * rcp_scaleOfWeight, coreSize)*lanczos((j + y_min - origin_y + 0.5) * rcp_scaleOfHeight, coreSize)
                    sum_w += w
                    dest_img[x][y] += (w * img[Math.round(i + x_min)][Math.round(j + y_min)])
                }
            dest_img[x][y] = Math.round(dest_img[x][y] / sum_w)
        }
    }
    return dest_img
}

function sigmoid(z) {
    return 1.0/(1.0+Math.exp(-z))
}

